import "./nav.css";

const prop = ["Home", "AboutAs", "Contact"]

export default function Nave(){  
    return (
        <ul className="nav_Container">
         {
          prop.map(e => {
            return <li>{e}</li>;
          })
        }
        </ul>
    )
}
